import React from "react";

export default function Contact() {
  return (
    <div style={{ padding: "20px", fontFamily: "sans-serif" }}>
      <h2>Developer Information</h2>
      <p><strong>Name:</strong> Pratik Gitte</p>
      <p><strong>Email:</strong> pratikgitte123@gmail.com</p>
      <p><strong>Role:</strong> Full Stack Developer</p>
      <h2>Creator of InstantSaver App for YouTube & Instagram downloads with previews.</h2>
    </div>
  );
}
